import {useState} from 'react'
import React from 'react';
function Button(){
  const[count,setCount]= useState(0);
  return(
    <button onClick={() => setCount(count=>(count+1))}>
      <strong>{count}</strong>
      </button>
  );
  <input type='text'>ENTER</input>

}
export default Button;
